import pytest
from data.input_code.t11 import *

@pytest.mark.parametrize('s, ch, expected', [
    ("hello", "l", "heo"),
    ("hello", "x", "hello"),
    ("", "a", ""),
    ("a", "a", ""),
    ("a", "b", "a"),
    ("hello", None, "hello"),
    (None, "a", None)
])
def test_remove_Occ(s, ch, expected):
    if s is None or ch is None:
        assert remove_Occ(s, ch) == expected
    else:
        assert remove_Occ(s, ch) == expected

def test_remove_Occ_error():
    with pytest.raises(TypeError):
        remove_Occ("hello", 1)

def test_remove_Occ_empty_string():
    assert remove_Occ("", "") == ""

def test_remove_Occ_single_character_string():
    assert remove_Occ("a", "a") == ""

def test_remove_Occ_single_character_string_empty():
    assert remove_Occ("a", "") == "a"

def test_remove_Occ_none_input():
    with pytest.raises(TypeError):
        remove_Occ(None, "a")

